    function computeFV(uint256[] memory challenges, int256[][] memory vs)
        internal
        returns (uint256[] memory)
    {

        uint256[] memory fvs = new uint256[](4);
        int256[][] memory ha = hadamard;

        for(uint i=0;i<4;i++) {
            int256[][] memory f = new int256[][](4);
            int256[] memory f_sum = new int256[](4);
            uint base = i * 4;
            for(uint j=0;j<4;j++) {
                uint idx = base + j;
                if(idx == 0) {
                    f[j] = mulConstant(ha[j], int(challenges[0]));
                } else {
                    f[j] = mulConstant(ha[j], int(mulmod(challenges[j], 2 << (idx-1), NN)));
                }

                f_sum = addVector(f[j], f_sum);
            }

            int256[] memory v = vs[i];
            f_sum = subVector(f_sum, v);
            fvs[i] = uint(dot(f_sum, v)) % NN;
        }

        return fvs;
    }

